import ExpenseItem from "./components/ExpenseItem";
import expenses from "./expense";

function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      {expenses.map(function Expense(exp) {
        return <ExpenseItem 
          key={exp.id}
        />;
      })}
    </div>
  );
}

export default App;
